import axios from 'axios'

const instance = axios.create({
    baseURL: 'https://imdb-internet-movie-database-unofficial.p.rapidapi.com/film/tt1375666',
    headers: {
        'x-rapidapi-host':'imdb-internet-movie-database-unofficial.p.rapidapi.com',
        'x-rapidapi-key': '222053d898mshb62cf6fa527cdb3p1ef3a7jsnfa5715ab6bf2'
    },
});

export default {
    getData: () =>
    instance({
        'method':'GET',
        'url':'/query',
        'params': {
            'search':'parameter',
        },
        transformResponse: [function (data) {
            // Do whatever you want to transform the data
            console.log('Transforming data...')

            const json = JSON.parse(data)

            // list of nested object keys
            const dates = Object.keys(json['nested object'])

            data = {
                dates
            }

            return data;
        }],
    }),
    postData: () =>
    instance({
        'method': 'POST',
        'url':'/api',
        'data': {
            'item1':'data1',
            'item2':'item2'
        },
        'headers': { 'content-type':'application/json' // override instance defaults
        },
    })
}
